(1, 86, 4, 'Edit', 'manual edit customer site-34533RSX', '2025-02-05 07:40:29', '2025-02-05 07:40:29'),
(2, 86, 4, 'Edit', 'Manual edit work requested-<!--StartFragment--><p><span data-olk-copy-source=\"MessageBody\" style=\"direction: ltr; margin: 0px; font-family: Aptos, Aptos_EmbeddedFont, Aptos_MSFontService, Calibri, Helvetica, sans-serif, serif, EmojiFont; font-size: 11pt; color: rgb(0, 0, 0);\">There is a printer AND Raspberry Pi offline on the sales floor. The printer should be connected to port 6 of the Cradlepoint router and the Raspberry Pi should be connected to the main unmanaged switch which is off of port 5 of the Cradlepoint&nbsp;router. Once network connection to both of these devices are confirmed, test to ensure the printer is able to print from the store iPads, they should be connected to the REMO WiFi network in order to use this printer. Also have the store manager test to make sure they can remotely open the cash registers as they are controlled by the Raspberry Pi. I have also included a troubleshooting guide for the Pi to give the technician more information.ok............</span></p>', '2025-02-05 08:07:24', '2025-02-05 08:07:24'),
(3, 86, 4, 'Edit', 'Manual edit work requested: -<!--StartFragment--><p><span data-olk-copy-source=\"MessageBody\" style=\"direction: ltr; margin: 0px; font-family: Aptos, Aptos_EmbeddedFont, Aptos_MSFontService, Calibri, Helvetica, sans-serif, serif, EmojiFont; font-size: 11pt; color: rgb(0, 0, 0);\">There is a printer AND Raspberry Pi offline on the sales floor. The printer should be connected to port 6 of the Cradlepoint router and the Raspberry Pi should be connected to the main unmanaged switch which is off of port 5 of the Cradlepoint&nbsp;router. Once network connection to both of these devices are confirmed, test to ensure the printer is able to print from the store iPads, they should be connected to the REMO WiFi network in order to use this printer. Also have the store manager test to make sure they can remotely open the cash registers as they are controlled by the Raspberry Pi. I have also included a troubleshooting guide for the Pi to give the technician more information.</span></p>', '2025-02-05 08:10:13', '2025-02-05 08:10:13'),
