INSERT INTO `ticket_notes` (`id`, `work_order_id`, `auth_id`, `general_notes`, `dispatch_notes`, `billing_notes`, `tech_support_notes`, `close_out_notes`, `created_at`, `updated_at`) VALUES
(1, 1, 34, NULL, NULL, NULL, NULL, 'Technicians worked with support team and reconfigured the server to communicate with the corporate office. \r\nAll work was tested by Eli at the corporate office.', '2024-09-24 12:45:55', '2024-09-24 12:45:55'),
(2, 1, 34, NULL, NULL, NULL, NULL, 'close out note written for dummy purpose', '2024-09-25 23:29:13', '2024-09-25 23:29:13'),
(3, 2, 34, NULL, NULL, NULL, NULL, 'This close out note written for demo purpose', '2024-10-03 00:31:55', '2024-10-03 00:31:55'),
(4, 2, 34, NULL, NULL, NULL, 'fgbl', NULL, '2024-10-10 09:33:05', '2024-10-10 09:33:05'),
(5, 4, 52, NULL, NULL, 'Charge customer 1 hour travel', NULL, NULL, '2024-10-22 13:18:26', '2024-10-22 13:18:26'),
(6, 4, 52, NULL, NULL, NULL, 'Tech support had to reprogram the NUC to communicate with server.', NULL, '2024-10-22 13:19:02', '2024-10-22 13:19:02'),
(7, 4, 52, NULL, NULL, NULL, NULL, 'Tech worked with tech support and completed the install.', '2024-10-22 13:19:25', '2024-10-22 13:19:25'),
(8, 4, 52, NULL, NULL, NULL, '2nd Tech support note.', NULL, '2024-10-22 13:27:48', '2024-10-22 13:27:48'),
(9, 4, 52, 'Tech can not find site contact.', NULL, NULL, NULL, NULL, '2024-10-22 15:14:44', '2024-10-22 15:14:44'),
(10, 9, 52, NULL, NULL, NULL, NULL, 'The tech troubleshot the switches with Lee and below are the findings: \r\n\r\nCisco SG350-10P - LAN IP Address: 192.168.4.33 Location: BLD-4 - Switch needs to be replaced. \r\nCisco SG350-10P - LAN IP Address: 192.168.4.36 Location: BLD-5 - Troubleshot with Lee and now it is working.  \r\nCisco SG350-10P - LAN IP Address: 192.168.4.35 Location: BLD-6 - Troubleshot with Lee and now it is working. \r\n\r\nPer Lee, okay to release the technician. \r\n\r\nWork Complete.', '2024-10-29 11:14:27', '2024-10-29 11:14:27'),
(11, 17, 52, NULL, NULL, NULL, NULL, '1.	Bill to and Ship to are uneven\r\na.	Need to add the address in the ship to, currently it only shows Name, City, State, Zip\r\n2.	The Job would be the type (pulled from WO)\r\na.	Project\r\nb.	Install\r\nc.	P3\r\nd.	P2\r\ne.	P1\r\nf.	MAC\r\n3.	Complete Date should be when the WO was closed.\r\n4.	Purchase Order  this could be a PO #, Customer WO# or any reference the client gives us.  It should pull the info from the WO\r\n5.	Qty  Needs first hour and additional hour, whether standard, nights, weekends, emergency, etc\r\na.	First hour is one for each trip\r\nb.	Additional hour is the total hours onsite in a day rounded up to the next half hour, then -1 hour\r\nc.	Materials can be free fill for now\r\n6.	Description  should pull from customer profile\r\n7.	Date  should pull from work order\r\n8.	Add dollar $igns to price and amount\r\n9.	We will need have the work performed and work requested fully visible on any invoice\r\n10.	Need to add Shipping/Handling', '2024-11-04 10:58:39', '2024-11-04 10:58:39'),
(12, 9, 52, NULL, NULL, NULL, NULL, 'Thank you for reaching out, this is Christian from Zoom Technical Support.\r\n\r\nI understand that you need assistance with activating 4-way calling, I know how important this is for you, rest assured I am here to assist you.\r\n\r\nUpon checking on our resources, It seems that you like to access the feature Zoom Phone Conference calls for your account. Zoom Phone conference call allows three or more participants to join the same phone call simultaneously.\r\n\r\nPlease provide a written confirmation that you would like to enable Multi Party Conferencing feature for your account so we can process your request.\r\n\r\nThank you for reaching out, this is Christian from Zoom Technical Support.\r\n\r\nI understand that you need assistance with activating 4-way calling, I know how important this is for you, rest assured I am here to assist you.\r\n\r\nUpon checking on our resources, It seems that you like to access the feature Zoom Phone Conference calls for your account. Zoom Phone conference call allows three or more participants to join the same phone call simultaneously.\r\n\r\nPlease provide a written confirmation that you would like to enable Multi Party Conferencing feature for your account so we can process your request.', '2024-11-06 10:34:42', '2024-11-06 10:34:42'),
(13, 25, 54, NULL, NULL, NULL, NULL, 'The tech arrived onsite today on time. Tech checked in with onsite contact Ryan. Requested parts and access from them. Then he worked with Albert the remote engineer on the bridge where Amadou the PM and I were present. The tech was having issues with the wifi then shared picture of the screen and then upon Albert\'s instructions he replaced the Nomadix server and NUC. Further tested wifi and upgraded service.   Parts were left onsite to site contact for e-waste as per Amadou\'s instructions.   Work is complete. Tech released on Amadou\'s confirmation.', '2024-11-18 16:47:40', '2024-11-18 16:47:40'),
(14, 28, 52, NULL, NULL, NULL, NULL, 'Tech worked with Tom Wilde to finish everything on site. \r\n worked with Tom Wilde to finish everything on site. \r\n worked with Tom Wilde to finish everything on site. \r\n worked with Tom Wilde to finish everything on site. \r\n worked with Tom Wilde to finish everything on site. \r\n worked with Tom Wilde to finish everything on site.', '2024-11-19 12:38:12', '2024-11-19 12:38:12'),
(15, 28, 52, NULL, NULL, NULL, NULL, 'worked with Tom Wilde to finish everything on site. \r\n worked with Tom Wilde to finish everything on site. \r\n worked with Tom Wilde to finish everything on site. \r\n worked with Tom Wilde to finish everything on site. \r\n worked with Tom Wilde to finish everything on site.', '2024-11-19 12:45:12', '2024-11-19 12:45:12'),
(16, 56, 34, 'hgfjhfjh', NULL, NULL, NULL, NULL, '2024-12-11 06:48:54', '2024-12-11 06:48:54'),
(17, 61, 54, NULL, NULL, NULL, NULL, 'The tech arrived at site and checked in with me then got the parts. After that I called you and conferenced the call with tech. Following your instructions he replaced the switch. After the second conference call he took the pictures and checked out with me and the site contact. Upon your confirmation the work was done, and everything was up and running. Requested photos are attached to this email Work completed.', '2024-12-19 10:43:13', '2024-12-19 10:43:13');
