(24, 0, 3, NULL, 1, NULL, NULL, '3', NULL, 20, 'S11106242524', '<p>Technician verbally confirmed the WO. This WO is in FN.</p>', NULL, '<ol><li>P-Touch Label Maker</li><li>Butt set REQUIRED</li><li>Camera to take pictures: REQUIRED</li><li>Laptop w/Windows 10 or later WiFi Analyzer Installed</li><li>Mobile device to test speedtest</li></ol><p><br>**Field tech will need a laptop and mobile device to troubleshoot with and to provide WiFi speed and<br>signal test results **</p>', '<p>Check in with PM at 331.330.9998 upon arrival.</p><p><br>Please introduce yourself and check in at the leasing office upon arrival.<br><br>1. Check in with property staff.<br>2. Follow the below instructions:</p><p> Request access to the ladder behind Building 7.<br> Work with the PM &amp; Support to fine tune the orientation between the roof mounted Siklu TU 4.214<br>on building 8 and Siklu BU 4.211 on Building 7.<br> Then work to fine tune the signal between Siklu TU 4.219 on Building 9 and Siklu BU 4.210 on<br>Building 11.</p><p><br>3. This tech dispatch is to troubleshoot the PtP antenna orientation and signal strength and ensure the<br>proper functioning and connectivity of the equipment. Especially addressing the WiFi signal and stability.<br>4. Perform troubleshooting on or escalate as necessary to resolve any specific on-site issues.<br>5. We should either resolve the issue, escalate for an onsite solution, or triage toward a resolution.</p>', '[]', 1, 2, 2, 0, NULL, NULL, 'Lee Goetsch', 'Email', '2', '<p>** Pictures and documentation of work performed are required **<br>** Project Manager will release technicians after reviewing escalations as they arise **<br>**Field tech will need a laptop and mobile device to troubleshoot with and to provide WiFi speed and<br>signal test results **</p>', NULL, NULL, 'single', NULL, NULL, NULL, NULL, '2024-11-06 13:45:18', '2025-01-05 17:21:14'),
