(38, 0, 3, NULL, 2, NULL, NULL, '5', 1022, 8, 'P11120243638', '<p>DBS sending Chris Cole #(814) 915-4458 onsite.</p>', NULL, '<p>Laptop REQUIRED<br>P-Touch Label Maker<br>Butt set<br>Camera to take pictures<br>Console Cable: (DB9 to USB) see requirements in Appendix A<br>Ladder 8</p>', '<p>Swap out (1) NOMADIX server.<br>Swap out (1) Firewall<br>Replacement equipment is already on site, we will be doing one-to-one swap.<br>Work with PM to confirm everything is online before leaving site.<br>1. Check in with site contact; to be provided by PM upon arrival on site.<br>2. Locate MDF and existing server.<br>3. Take pictures of existing equipment.<br>4. Work with PM and Support to swap out equipment.<br>5. Confirm everything is online.<br>6. Take post installation pictures<br>7. Use the same boxes to pack de-installed equipment. Take pictures of boxed equipment.<br>Leave with site contact and capture first and last name.<br>8. Send all pictures and deliverables to adostagir@techyeahinc.com</p>', '[\"38_Picture1.jpg\"]', 2, NULL, 3, 0, NULL, NULL, 'Amadou Thiam', 'Email', '1', '<p>Send all deliverables to adostagir@techyeahinc.com<br>1. Pre- Photos:<br>a. MDF<br>2. Post Photos:<br>a. MDF<br>3. Each installed Equipment:<br>a. (1) close up<br>b. (1) take a few steps back and take a picture</p>', NULL, NULL, 'single', NULL, NULL, NULL, NULL, '2024-11-20 09:55:03', '2024-12-29 12:33:46'),
