(45, 0, 3, NULL, 1, NULL, NULL, '5', NULL, 16, 'S11204247945', NULL, NULL, '<p>Laptop<br>Toner/Wand<br>Power Drill<br>Console Cable</p>', '<p>***You are representing Tech Yeah on site, introduce yourself as such***<br><br>On-Site Tasks<br><br>1.   Check in with site contact.<br><br> 2.   Locate MDF and existing server. <br><br> 3.   Take pictures of existing equipment.<br><br> 4.   Work with PM and Support to swap out equipment. <br><br> 5.   Confirm everything is online. <br><br> 6.   Take post installation pictures<br><br> 7.   Use the same boxes to pack de-installed equipment. Take pictures of boxed equipment. Leave with site contact and capture first and last name. <br><br> 8.   Send all pictures and deliverables to adostagir@techyeahinc.com<br><br><br><br>Required On-Site Deliverables <br><br>Check-out of work order<br>Photos<br>Signed WO<br>Escalation Process:<br><br>If clarification is needed on work order, discuss with TechYeah PM at 331 330 9998<br>Any issues or questions should be escalated to TechYeah PM at 331 330 9998<br>Additional Hours &amp; Expenses Approval Payment Policy<br><br>Additional time on site must be pre-approved by TechYeah PM at 331 330 9998</p>', NULL, 2, 2, 2, 0, NULL, NULL, 'Amadou Thiam', NULL, NULL, NULL, NULL, NULL, 'single', NULL, NULL, NULL, NULL, '2024-12-04 07:33:37', '2024-12-24 23:05:08'),
(46, 0, 3, NULL, 1, NULL, NULL, '5', 2039, 19, 'S11205245646', '<p>FN WO</p>', NULL, '<p style=\"margin-bottom: 16px; margin-top: 0px;\"><br><em><strong>Laptop</strong></em></p><ul><li style=\"margin-bottom: 16px;\"><em><strong>Toner/Wand</strong></em></li><li style=\"margin-bottom: 16px;\"><em><strong>Power Drill</strong></em></li><li style=\"margin-bottom: 16px;\"><em><strong>Laptop</strong></em></li><li style=\"margin-bottom: 16px;\"><em><strong>Console Cable</strong></em></li></ul><p><br></p>', '<p><span data-teams=\"true\"><p style=\"margin-bottom: 16px; margin-top: 0px;\"><strong>***You are representing Tech Yeah on site, introduce yourself as such***</strong></p><p style=\"margin-bottom: 16px; margin-top: 0px;\"><em><strong>On-Site Tasks</strong></em></p><p style=\"margin-bottom: 16px; margin-top: 0px;\">1.&nbsp;&nbsp;&nbsp;Check in with site contact.</p><p style=\"margin-bottom: 16px; margin-top: 0px;\">&nbsp;2.&nbsp;&nbsp;&nbsp;Locate MDF and existing server.</p><p style=\"margin-bottom: 16px; margin-top: 0px;\">&nbsp;3.&nbsp;&nbsp;&nbsp;Take pictures of existing equipment.</p><p style=\"margin-bottom: 16px; margin-top: 0px;\">&nbsp;4.&nbsp;&nbsp;&nbsp;Work with PM and Support to swap out equipment.</p><p style=\"margin-bottom: 16px; margin-top: 0px;\">&nbsp;5.&nbsp;&nbsp;&nbsp;Confirm everything is online.</p><p style=\"margin-bottom: 16px; margin-top: 0px;\">&nbsp;6.&nbsp;&nbsp;&nbsp;Take post installation pictures</p><p style=\"margin-bottom: 16px; margin-top: 0px;\">&nbsp;7.&nbsp;&nbsp;&nbsp;Use the same boxes to pack de-installed equipment. Take pictures of boxed equipment. Leave with site contact and capture first and last name.</p><p style=\"margin-bottom: 16px; margin-top: 0px;\">&nbsp;8.&nbsp;&nbsp;&nbsp;Send all pictures and deliverables to adostagir@techyeahinc.com</p><p style=\"margin-bottom: 16px; margin-top: 0px;\">&nbsp;<br></p><p style=\"margin-bottom: 16px; margin-top: 0px;\"><em><strong>Required On-Site Deliverables</strong></em>&nbsp;</p><ol><li style=\"margin-bottom: 16px;\">Check-out of work order</li><li style=\"margin-bottom: 16px;\">Photos</li><li style=\"margin-bottom: 16px;\">Signed WO</li></ol><p style=\"margin-bottom: 16px; margin-top: 0px;\"><strong>Escalation Process:</strong></p><ul><li style=\"margin-bottom: 16px;\">If clarification is needed on work order, discuss with TechYeah PM at 331 330 9998</li><li style=\"margin-bottom: 16px;\">Any issues or questions should be escalated to TechYeah PM at 331 330 9998</li></ul><p style=\"margin-bottom: 16px; margin-top: 0px;\"><strong>Additional Hours &amp; Expenses Approval Payment Policy</strong></p><ul><li style=\"margin-bottom: 16px;\">Additional time on site must be pre-approved by TechYeah PM at 331 330 9998</li></ul></span></p>', NULL, 2, 3, 3, 0, NULL, NULL, 'Amadou Thiam', 'Email', '1', '<p><br></p>', NULL, NULL, 'single', NULL, NULL, NULL, NULL, '2024-12-05 10:27:29', '2024-12-16 09:58:30'),
(47, 0, 3, NULL, 2, NULL, NULL, '3', NULL, 23, 'P11205247747', '<p><br></p>', NULL, '<p>Laptop REQUIRED<br>P-Touch Label Maker<br>Butt set<br>Camera to take pictures<br>Console Cable: (DB9 to USB) see requirements in Appendix A</p>', '<p>Swap out (2) NOMADIX server.<br>Swap out (2) Firewall<br>Replacement equipment is already on site, we will be doing one-to-one swap.<br>Work with PM to confirm everything is online before leaving site.<br>1. Check in with site contact; to be provided by PM upon arrival on site.<br>2. Locate MDF and existing server.<br>3. Take pictures of existing equipment.<br>4. Work with PM and Support to swap out equipment.<br>5. Confirm everything is online.<br>6. Take post installation pictures<br>7. Use the same boxes to pack de-installed equipment. Take pictures of boxed equipment.<br>Leave with site contact and capture first and last name.<br>8. Send all pictures and deliverables to adostagir@techyeahinc.com</p>', NULL, 2, 4, 3, 0, NULL, NULL, 'Amadou Thiam', 'Email', '1', '<p>1. Pre- Photos:<br>a. MDF<br>2. Post Photos:<br>a. MDF<br>3. Each installed Equipment:<br>a. (1) close up<br>b. (1) take a few steps back and take a picture</p>', NULL, NULL, 'single', NULL, NULL, NULL, NULL, '2024-12-05 13:42:11', '2025-01-03 22:58:41');
