(49, 0, 3, NULL, 2, NULL, NULL, '5', 3710, 26, 'P11206247949', NULL, NULL, '<p>Laptop REQUIRED<br>P-Touch Label Maker<br>Butt set<br>Camera to take pictures<br>Console Cable: (DB9 to USB) see requirements in Appendix A</p>', '<p>Swap out (1) NOMADIX server.<br>Swap out (1) Firewall<br>Replacement equipment is already on site, we will be doing one-to-one swap.<br>Work with PM to confirm everything is online before leaving site.<br>1.Check in with site contact; to be provided by PM upon arrival on site.<br>2.Locate MDF and existing server.<br>3.Take pictures of existing equipment.<br>4.Work with PM and Support to swap out equipment.<br>5.Confirm everything is online.<br>6.Take post installation pictures<br>7.Use the same boxes to pack de-installed equipment. Take pictures of boxed equipment.<br>Leave with site contact and capture first and last name.<br>8.Send all pictures and deliverables toadostagir@techyeahinc.com</p>', NULL, 2, 9, 3, 0, NULL, NULL, 'Amadou Thiam', 'Email', '1', '<p>1.Pre- Photos:<br>a.MDF<br>2.Post Photos:<br>a.MDF<br>3.Each installed Equipment:<br>a.(1) close up<br>b.(1) take a few steps back and take a picture</p>', NULL, NULL, 'single', NULL, NULL, NULL, NULL, '2024-12-06 13:15:47', '2025-01-07 02:44:41'),
