(61, 0, 3, NULL, 1, NULL, NULL, '3', 3763, 3, 'S11216241661', '<p><br></p>', NULL, '<p> ** Field tech will need a laptop and mobile device to troubleshoot with and to provide WiFi speed and signal test results&nbsp; Also needed are network cable termination tools and modular plugs**</p>', '<div data-ogsc=\"rgb(0, 0, 0)\" data-olk-copy-source=\"MessageBody\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0) !important; text-align: left; text-indent: 0px;\">** Pictures and documentation of work performed are required **</div><div data-ogsc=\"rgb(0, 0, 0)\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0) !important; text-align: left; text-indent: 0px;\"> ** Checking in &amp; out with PM is required for tracking &amp; billing purposes **</div><div data-ogsc=\"rgb(0, 0, 0)\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0) !important; text-align: left; text-indent: 0px;\">** Project Manager will release technicians after reviewing escalations as they arise **</div><div data-ogsc=\"rgb(0, 0, 0)\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0) !important; text-align: left; text-indent: 0px;\"><br></div><div data-ogsc=\"rgb(0, 0, 0)\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0) !important; text-align: left; text-indent: 0px;\">1. Report to site and check in with front desk/manager on duty. Request the replacement switch and access to the Building 4 NEMA enclosure. Work with PM and Remote Engineer to replace the network switch.</div><div data-ogsc=\"rgb(0, 0, 0)\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0) !important; text-align: left; text-indent: 0px;\"><br></div><div data-ogsc=\"rgb(0, 0, 0)\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0) !important; text-align: left; text-indent: 0px;\">Cisco SG350-10P - LAN IP Address: 192.168.4.33 Location: BLD-4</div><div data-ogsc=\"rgb(0, 0, 0)\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0) !important; text-align: left; text-indent: 0px;\"><br></div><div data-ogsc=\"rgb(0, 0, 0)\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0) !important; text-align: left; text-indent: 0px;\">3. Tech is to replace the failed switch and ensure the proper functioning and connectivity of the network equipment. Especially addressing the WiFi signal and stability.</div><div data-ogsc=\"rgb(0, 0, 0)\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0) !important; text-align: left; text-indent: 0px;\">4. Perform troubleshooting on or escalate as necessary to resolve any specific on-site issues.</div><div data-ogsc=\"rgb(0, 0, 0)\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0) !important; text-align: left; text-indent: 0px;\">5. We should resolve the issue, escalate for an onsite solution, or triage toward a resolution.</div>', NULL, 1, NULL, 5, 0, NULL, NULL, 'Lee Goetsch', 'Email', '1', '<p><br></p>', NULL, NULL, 'single', NULL, NULL, NULL, NULL, '2024-12-16 12:33:19', '2025-01-04 13:24:03');
